import React, { useState, useEffect } from "react";
import VoiceEmotionalAgent from "./components/VoiceEmotionalAgent";
import EmotionalMemoryAgent from "./components/EmotionalMemoryAgent";
import EmotionalArc from "./components/EmotionalArc";
import "./components/CompleteApp.css";

function App() {
  const [messages, setMessages] = useState([]);
  const [emotionalArc, setEmotionalArc] = useState([]);
  const [currentMood, setCurrentMood] = useState("neutral");
  const [backgroundColor, setBackgroundColor] = useState("#f5f5f5");

  // Initialize with welcome message
  useEffect(() => {
    const welcomeMessage = {
      text: "Welcome to the Emotional Agent Orchestra! I'm your complete emotional intelligence system with voice analysis, memory tracking, and real-time emotional visualization.",
      sender: "bot",
      timestamp: new Date(),
      mood: "excited",
      voiceEmotion: "neutral"
    };

    setMessages([welcomeMessage]);
    setEmotionalArc([{
      timestamp: new Date(),
      mood: "excited",
      intensity: 0.8,
      trigger: "system_start"
    }]);
  }, []);

  // Unified message handler that updates all components
  const handleUnifiedMessage = (messageData) => {
    const { text, sender, voiceEmotion, audioData } = messageData;

    // Add message to unified timeline
    const newMessage = {
      ...messageData,
      timestamp: new Date()
    };
    setMessages(prev => [...prev, newMessage]);

    // Update emotional arc
    const newArcPoint = {
      timestamp: new Date(),
      mood: voiceEmotion || "neutral",
      intensity: audioData ? calculateIntensity(audioData) : 0.5,
      trigger: sender === "user" ? "user_input" : "bot_response"
    };
    setEmotionalArc(prev => [...prev, newArcPoint]);

    // Update current mood and background
    updateVisualState(voiceEmotion || "neutral", audioData);
  };

  const calculateIntensity = (audioData) => {
    if (!audioData) return 0.5;
    const { energy, average } = audioData;
    return Math.min((energy || 0) / 100, 1);
  };

  const updateVisualState = (mood, audioData) => {
    setCurrentMood(mood);

    const moodColors = {
      excited: "#fff3e0",
      happy: "#e8f5e8",
      sad: "#e3f2fd",
      angry: "#ffebee",
      calm: "#f3e5f5",
      anxious: "#fff8e1",
      neutral: "#f5f5f5"
    };

    setBackgroundColor(moodColors[mood] || "#f5f5f5");
  };

  return (
    <div className="agent-orchestra-container" style={{ backgroundColor }}>
      <header className="orchestra-header">
        <h1>ðŸŽ­ Emotional Agent Orchestra</h1>
        <div className="system-status">
          <div className="mood-indicator">
            <span className="current-mood">Current Mood: {currentMood}</span>
            <div className="mood-orb" style={{ backgroundColor }}></div>
          </div>
        </div>
      </header>

      <main className="orchestra-main">
        {/* Left Panel: Voice Emotional Agent */}
        <section className="voice-section">
          <h2>ðŸŽ¤ Voice Emotional Agent</h2>
          <VoiceEmotionalAgent 
            onMessage={handleUnifiedMessage}
            currentMood={currentMood}
          />
        </section>

        {/* Center Panel: Emotional Memory Agent */}
        <section className="memory-section">
          <h2>ðŸ§  Emotional Memory Agent</h2>
          <EmotionalMemoryAgent 
            messages={messages}
            onUpdate={handleUnifiedMessage}
            emotionalArc={emotionalArc}
          />
        </section>

        {/* Right Panel: Emotional Arc */}
        <section className="arc-section">
          <h2>ðŸ“Š Emotional Arc</h2>
          <EmotionalArc 
            emotionalArc={emotionalArc}
            messages={messages}
            currentMood={currentMood}
          />
        </section>
      </main>

      <footer className="orchestra-footer">
        <div className="real-time-stats">
          <span>Messages: {messages.length}</span>
          <span>Emotional States: {emotionalArc.length}</span>
          <span>Active Analysis: {isListening ? 'Voice' : 'Text'}</span>
        </div>
      </footer>
    </div>
  );
}

export default App;
